import "./login.css";

export default function login() {
  return (
    <div className="login">
      <div className="loginWrapper">
        <div className="loginLeft">
          <h1 className="loginLogo">To Do List!</h1>
          <span className="loginDescription">List What Your To Do</span>
        </div>
        <div className="loginRight"></div>
      </div>
    </div>
  );
}
